export const Table = ({chartData}) => {

    const tableData = chartData?.map((item)=>{
        return (
            <tr>
            <th>{item[0]}</th>
            <th>{item[1]}</th>
          </tr>
        )
    })


    return (
        <table>
            {tableData}
        </table>
    )
}
